Hello there,

I was trying the newly added GCS support, and I am encountering this error when trying to write a dataset via the python API:

```bash
[...]
File "YYY/lib/python3.9/site-packages/lance/dataset.py", line 654, in write_dataset
    _write_dataset(reader, uri, params)
OSError: LanceError(I/O): Generic GCS error: Error performing copy request 3d217d1b-1a94-436f-8726-0d955df92fba.lance/_versions/1.manifest: response error "{
  "error": {
    "code": 400,
    "message": "Rewriting objects created via Multipart Upload is not implemented yet. As a workaround, you can use compose to overwrite the object (by specifying XXX/3d217d1b-1a94-436f-8726-0d955df92fba.lance/_versions/1.manifest as both the source and output of compose) prior to rewrite.",
    "errors": [
      {
        "message": "Rewriting objects created via Multipart Upload is not implemented yet. As a workaround, you can use compose to overwrite the object (by specifying XXX/3d217d1b-1a94-436f-8726-0d955df92fba.lance/_versions/1.manifest as both the source and output of compose) prior to rewrite.",
        "domain": "global",
        "reason": "invalid"
      }
    ]
  }
}
```

Any idea of what is going on?
